        return(
            <div className={"Middle-layout"} >
                <Title >Welcome to Uvid</Title>
                <h3>please enter your name before joining</h3>
                <Input placeholder="add your name"  />
                <Button  className={"enter-button"} shape={"round"}> Join </Button>
            </div>
        )
    }
}


export default Home;
